                     Exploring the World of Aquatic Life-2010kaiser
                     ~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~


From the ocean depths to river rapids, fascinating aquatic life can be found in all climates and settings.
Geared toward young students, the fresh, new Exploring the World of Aquatic Life set is packed with information, naturalistic artwork,
helpful maps, and stunning full-color photography intended to illustrate key life-science principles while providing thorough information on the fish, mammals,
and invertebrates that live a largely aquatic life.

Name: Exploring the World of Aquatic Life (Vol 1-6)
Publisher: Chelsea House Publications
Author: John Dawes, Andrew Campbell
Year: 2008
Format: PDF
ISBN: 978-1604132557

